import React from 'react'
import ReactDOM from 'react-dom'

const Hello = (propss) => {
    return (
      <div>
        <p>Hello {propss.name}</p>
      </div>
    )
  }

  const App = () => {
    return (
      <div>
        <h1>Greetings</h1>
        <Hello name="George" />
        <Hello name="Daisy" />
      </div>
    )
  }


ReactDOM.render(<App />, document.getElementById('root'))
